def LinearlyScaled(value, range_start, minimum=None, maximum=None, offset=0):
    if minimum is not None and maximum is not None:
        scaled = (value - range_start + offset) / (maximum - minimum)
        return max(0, min(1, scaled))
    else:
        scaled = (value - offset)
        return max(0, min(1, scaled))

