def compute_ring_circulation_from_master_curve(l, veff, dp=160., do=25.6, N=8, setting='medium'):

    if setting == 'medium':
        dp, do, N = 160, 25.6, 8.
    elif setting == 'small':
        dp, do, N = 56.7, 12.8, 8.
    lstar = 1. / N * (dp / do) ** 2 * l / do
    gammaStar = (do * veff / N * (dp/do)**2)
    circulation = 0.43794512 * gammaStar * lstar ** (2/3.)

    return circulation

