def geometric_key(xyz, precision='3f', tolerance=1e-9, sanitize=True):

    x, y, z = xyz
    if precision == 'd':
        return '{0},{1},{2}'.format(int(x), int(y), int(z))
    if sanitize:
        tolerance = tolerance ** 2
        if x ** 2 < tolerance:
            x = 0.0
        if y ** 2 < tolerance:
            y = 0.0
        if z ** 2 < tolerance:
            z = 0.0
    return '{0:.{3}},{1:.{3}},{2:.{3}}'.format(x, y, z, precision)

