    i = min(i, 1.0)
    r = b = min((1 - i) * 255, 255)
    if not normalize:
        return int(r), 255, int(b)
    return r / 255, 1.0, b / 255

def reflect(x, n):

    k = x.dot(n)
    return x - 2.0 * k * n

