def bisect(sequence, value, key=None, side='left'):


    has_key = key is not None
    lo = 0
    hi = len(sequence)

    if side == 'left':
        while lo < hi:
            mid = (lo + hi) // 2
            if value <= (key(sequence[mid]) if has_key else sequence[mid]):
                hi = mid
            else:
                lo = mid + 1

    elif side == 'right':
        while lo < hi:
            mid = (lo + hi) // 2
            if value < (key(sequence[mid]) if has_key else sequence[mid]):
                hi = mid
            else:
                lo = mid + 1

    else:
        message = "Unknown side specified! -> '%s'" % side
        raise ValueError(message)

    return lo

def bayesian_targeting_policy(tau_pred, contact_cost, offer_accept_prob, offer_cost, value=None):

    if value:
        tau_pred = tau_pred * value

    return (tau_pred > (offer_accept_prob * offer_cost - contact_cost)).astype('int')

import torch

def _axis_angle_rotation(axis: str, angle):


    cos = torch.cos(angle)
    sin = torch.sin(angle)
    one = torch.ones_like(angle)
    zero = torch.zeros_like(angle)

    if axis == "X":
        R_flat = (one, zero, zero, zero, cos, -sin, zero, sin, cos)

    if axis == "Y":
        R_flat = (cos, zero, sin, zero, one, zero, -sin, zero, cos)

    if axis == "Z":
        R_flat = (cos, -sin, zero, sin, cos, zero, zero, zero, one)

    return torch.stack(R_flat, -1).reshape(angle.shape + (3, 3))

