import torch

def cross_entropy_loss(logits, targets):

    x = logits
    x_max = x.data.max()
    log_sum_exp = torch.log(torch.sum(torch.exp(x - x_max), 1)) + x_max
    return log_sum_exp - x.gather(1, targets.view(-1, 1)).view(-1)

