def find_interval_index(array, low, high, search_value):

    while low < high:
        mid = int((high+low)//2)
        if array[mid] == search_value:
            break
        elif array[mid] > search_value:
            high = mid - 1
        else:
            low = mid + 1

    mid = int((high+low)//2)
    if search_value <= array[mid]:
        return mid

    return mid + 1

