    dims = data.shape
    if len(dims) == 2:
        if instrument_name.lower() != 'miri':
            return data[4:-4, 4:-4]
        else:
            return data[:, 4:-4]
    elif len(dims) == 3:
        if instrument_name.lower() != 'miri':
            return data[:, 4:-4, 4:-4]
        else:
            return data[:, :, 4:-4]

def truncate(x):


    if len(str(int(float(x)))) == 1:
        x = format(x, ".8f")
    if len(str(int(float(x)))) == 2:
        x = format(x, ".7f")
    if len(str(int(float(x)))) == 3:
        x = format(x, ".6f")
    if len(str(int(float(x)))) == 4:
        x = format(x, ".5f")
    if len(str(x)) > 10:
        x = round(x, 10)
    return x

